import React from 'react';
import Proyectos from './Proyectos';

const proyect = ({proyecto}) => {
    return (
        <li>
            <button
                type="button"
                className="btn btn-blank"
            >
                {proyecto.nombre}
            </button>
        </li>
    );
};

export default proyect;
